--IDENTIFY/CONFIRM DUPLICATES
SELECT client_name, COUNT(client_name) AS NumOccurrences
FROM import_client_license
GROUP BY client_name HAVING (COUNT(client_name) > 1);


--IDENTIFY UNIQUE ENTRIES
SELECT s.import_client_license_id
	FROM 
	(SELECT MAX(import_client_license_id) as import_client_license_id, client_name
	FROM import_client_license
	GROUP BY client_name
	ORDER BY client_name) s;


--DELETE DUPLICATES
DELETE 
	FROM import_client_license 
	WHERE import_client_license_id NOT IN 
	(SELECT s.import_client_license_id
	FROM 
	(SELECT MAX(import_client_license_id) as import_client_license_id, client_name
	FROM import_client_license
	GROUP BY client_name
	ORDER BY client_name) s);
	COMMIT;


