--insert client license
ALTER TRIGGER tr_start_workflow DISABLE;

	select distinct client.client_id, license.license_id, '1', '1'
	from import_client_license
	inner join license on license.license_abbrev = import_client_license.license_abbrev
	inner join client on upper(trim(client.client_name)) = upper(trim(import_client_license.client_name));
	commit;

ALTER TRIGGER tr_start_workflow ENABLE;


select client.client_id, contact_person_name, ceo_title, contact_email
from import_client_license
inner join client on upper(trim(client.client_name)) = upper(trim(import_client_license.client_name))
where import_client_license.contact_person_name is not null;
commit;
